import React, { useState } from 'react';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    service: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission here
    console.log('Form submitted:', formData);
    alert('Thank you for your message! We will get back to you soon.');
    setFormData({ name: '', email: '', phone: '', service: '', message: '' });
  };

  // Phone numbers from environment variables or fallback to company numbers
  const phoneNumbers = [
    process.env.REACT_APP_PHONE_1 || '+91 90804 02204',
    process.env.REACT_APP_PHONE_2 || '+91 93601 40985',
    process.env.REACT_APP_PHONE_3 || '+91 70103 90021',
    process.env.REACT_APP_PHONE_4 || '+91 97878 49000'
  ];

  return (
    <div className="container">
      <section className="page-section">
        <h1 className="section-title">Contact Us</h1>
        <div className="section-content">
          <p>Reach out to us for any construction requirements or vehicle hire:</p>
          
          <div style={{ marginBottom: '2rem' }}>
            <h3>Phone Numbers</h3>
            <div style={{ display: 'flex', flexDirection: 'column', gap: '0.5rem', marginTop: '1rem' }}>
              {phoneNumbers.map((phone, index) => (
                <a 
                  key={index}
                  href={`tel:${phone}`} 
                  style={{ color: '#007bff', textDecoration: 'none', fontSize: '1.1rem' }}
                >
                  {phone}
                </a>
              ))}
            </div>
          </div>

          <div style={{ marginBottom: '2rem' }}>
            <h3>Business Information</h3>
            <p><strong>{process.env.REACT_APP_COMPANY_NAME || 'Sathguru Babaji Traders'} MTP</strong></p>
            <p><strong>Fort Road Contractor & Building Material Supplier</strong></p>
            <p>Your One-Stop Solution for All Construction Needs</p>
          </div>

          {/* Location Images */}
          <div style={{ marginBottom: '2rem' }}>
            <h3>Our Location & Operations</h3>
            <div style={{
              display: 'grid',
              gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
              gap: '1rem',
              marginTop: '1rem'
            }}>
              <img 
                src="/uploads/HOME PAGE/road construction.jpg" 
                alt="Road Construction Work"
                style={{
                  width: '100%',
                  height: '200px',
                  objectFit: 'cover',
                  borderRadius: '8px'
                }}
              />
              <img 
                src="/uploads/HOME PAGE/Vehicles.jpg" 
                alt="Our Vehicles"
                style={{
                  width: '100%',
                  height: '200px',
                  objectFit: 'cover',
                  borderRadius: '8px'
                }}
              />
              <img 
                src="/uploads/HOME PAGE/building trust.jpg" 
                alt="Building Construction"
                style={{
                  width: '100%',
                  height: '200px',
                  objectFit: 'cover',
                  borderRadius: '8px'
                }}
              />
            </div>
          </div>

          <form onSubmit={handleSubmit} style={{ maxWidth: '600px', margin: '2rem auto' }}>
            <div style={{ marginBottom: '1rem' }}>
              <label htmlFor="name" style={{ display: 'block', marginBottom: '0.5rem' }}>Name:</label>
              <input
                type="text"
                id="name"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
                style={{ width: '100%', padding: '0.5rem', border: '1px solid #ddd', borderRadius: '4px' }}
              />
            </div>
            
            <div style={{ marginBottom: '1rem' }}>
              <label htmlFor="email" style={{ display: 'block', marginBottom: '0.5rem' }}>Email:</label>
              <input
                type="email"
                id="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                style={{ width: '100%', padding: '0.5rem', border: '1px solid #ddd', borderRadius: '4px' }}
              />
            </div>
            
            <div style={{ marginBottom: '1rem' }}>
              <label htmlFor="phone" style={{ display: 'block', marginBottom: '0.5rem' }}>Phone:</label>
              <input
                type="tel"
                id="phone"
                name="phone"
                value={formData.phone}
                onChange={handleChange}
                required
                style={{ width: '100%', padding: '0.5rem', border: '1px solid #ddd', borderRadius: '4px' }}
              />
            </div>

            <div style={{ marginBottom: '1rem' }}>
              <label htmlFor="service" style={{ display: 'block', marginBottom: '0.5rem' }}>Service Interested In:</label>
              <select
                id="service"
                name="service"
                value={formData.service}
                onChange={handleChange}
                style={{ width: '100%', padding: '0.5rem', border: '1px solid #ddd', borderRadius: '4px' }}
              >
                <option value="">Select a service</option>
                <option value="road-construction">Road Construction</option>
                <option value="building-construction">Building Construction</option>
                <option value="vehicle-rental">Vehicle Rental</option>
                <option value="cement-supply">Cement Supply</option>
                <option value="tmt-supply">TMT Steel Supply</option>
                <option value="layout-development">Layout Development</option>
                <option value="other">Other</option>
              </select>
            </div>
            
            <div style={{ marginBottom: '1rem' }}>
              <label htmlFor="message" style={{ display: 'block', marginBottom: '0.5rem' }}>Message:</label>
              <textarea
                id="message"
                name="message"
                value={formData.message}
                onChange={handleChange}
                required
                rows="5"
                style={{ width: '100%', padding: '0.5rem', border: '1px solid #ddd', borderRadius: '4px' }}
                placeholder="Please describe your construction requirements..."
              ></textarea>
            </div>
            
            <button 
              type="submit"
              style={{
                padding: '10px 30px',
                backgroundColor: '#007bff',
                color: 'white',
                border: 'none',
                borderRadius: '5px',
                cursor: 'pointer',
                fontSize: '1rem'
              }}
            >
              Send Message
            </button>
          </form>
        </div>
      </section>
    </div>
  );
};

export default Contact;
